import React, { Component } from 'react';
import { render } from "react-dom";
import { Chrono } from "react-chrono";
import { ThemeConsumer } from 'styled-components';

const items = [
    {
        title: "Apr 2021",
      },
      {
        title: "Jan 2021",
      },
      {
        title: "Nov 2020",
      },
];

class NewTimeline extends Component {
    render() {
        return (
            <div style={{ width: "100%", height: "100%" }}>
            <Chrono
              items={items}
              mode="VERTICAL_ALTERNATING"
              hideControls="true"
              theme={{primary: "#cdcdcd", secondary: "none", cardBgColor: "#00011c", cardForeColor: "#cdcdcd" }} 
              >
            <div>
                <h3 className="right">AfterClass Intern</h3>
                <p className="p2 right">Coming soon, while we work on it after class</p>
            </div>
            <div>

                <h3 className="left">SMU Business Intelligence and Analytics Data Associate</h3>
                <p className="p2 left">Utilised machine learning models to develop a coding language classifier</p>
            </div>
            <div>
                <h3 className="right">Ellipsis Marketing Executive</h3>
                <p className="p2 right">Designed marketing collaterals campaigns and events , electronic direct mails and social media posts for campaigns and events</p>
            </div>
            </Chrono>
          </div>
        );
    }
}

export default NewTimeline;
